  \"2016-01-28T07:20:18.897923\",\n\t\"name\": \"open-spaces-riverwalk\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 2009, CDOT opened the first sections
  of the river-level walkway from Michigan Avenue to State Street.  The walkway winds
  under the Michigan and Wabash bridges, providing an uninterrupted route along the
  river from State Street to the lakefront.rnrnThe walkway was built out 17-20 feet
  into the river to create a new shoreline.  Future plans call for extending the Riverwalk
  to Franklin.  CDOT built the basic infrastructure for the Riverwalk as part of the
  Wacker Drive reconstruction of 2001-02. From spring to fall, the Riverwalk is home
  to several restaurants and retail spaces. rnrnTo view or use these shapefiles, compression
  software and special GIS software, such as ESRI ArcGIS, is required. To download,
  right-click the \"Download\" link above and choose \"Save link as.\"\",\n\t\"license_title\":
